import React, { useState, useEffect } from "react";
import Axios from "../../node_modules/axios";

function Indexinter() {
  var inteobj = []
  const [axlist, setstate] = useState(inteobj)
  let testarr = []

  useEffect(() => {
    localStorage.setItem("test", JSON.stringify([]));
    let currentTest = localStorage.getItem("test");
    testarr = JSON.parse(currentTest);
    console.log(testarr)
    Axios.get("http://interviewapi.stgbuild.com/getQuizData").then((response) => {
    const inlist = response.data.tests
    setstate(inlist)
  })
  },[])

  //console.log(axlist)



  const listItems = axlist.map((test) =>
  <tr>
  <td>{test.name}</td>
   <td>{test.questions.length}</td>
   <td>
  <a 
  class="btn btn-warning"
  onClick={()=>testtype()}
  href={"/test/"+test._id+"/"+0}>Start Test</a>
  </td>
  </tr>
);


  return (
    <>
      <div class="container">
        <div class="row">
          <h1>My Interview Portal</h1>
          <hr/>
          <div class="col-md-12">
            <table class="table table-striped">
              <thead>
                <tr>
                  <th>Test</th>
                  <th>No of Questions</th>
                  <th></th>
                </tr>
              </thead>
              <tbody>
                {listItems}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </>
  );
}

export default Indexinter;
